import React, { useContext } from "react"; // Import React and useContext
import SingleProjectContext from "../../context/SingleProjectContext"; // Import the context

const ProjectGallery = () => {
  const { singleProjectData } = useContext(SingleProjectContext); // Get data from the context

  return (
    <div className="grid grid-cols-1 sm:grid-cols-3 sm:gap-10 mt-12">
      {singleProjectData.ProjectImages.map((project) => (
        <div className="mb-10 sm:mb-0" key={project.id}>
          <img
            src={project.img}
            className="rounded-xl cursor-pointer shadow-lg sm:shadow-none"
            alt={project.title}
            key={project.id}
            style={{ width: "100%", height: "100%", objectFit: "cover" }} // Set image dimensions
          />
        </div>
      ))}
    </div>
  );
};

export default ProjectGallery;
